import React from "react";
import Head from "next/head";
import styled from "styled-components";
import Layout from "../component/Layout";
import FirstImage from "../component/image";
import axios from "axios";
import { Col, Row } from "reactstrap";
import { observer } from "mobx-react-lite";
import CardList from "../component/contents/cardlist";
import { useEffect } from "react";
import ReactGA from "react-ga";
import TagManager from "react-gtm-module";
const Test = styled.div`
  color: red;
`;
const Index = observer((props) => {
  useEffect(() => {
    ReactGA.initialize("UA-167569535-1");
    // ReactGA.pageview(window.location.pathname + window.location.search);
    const tagManagerArgs = {
      gtmId: "GTM-MGN9D85",
    };

    TagManager.initialize(tagManagerArgs);
  }, []);
  return (
    <div>
      <Head>
        <meta charSet="utf-8" />
        <title>Index 페이지</title>
      </Head>
      <Layout>
        {" "}
        <Col md="12" xs="12">
          <FirstImage />
          {/* <SlideImage />
            <hr />
             <HotTest />*/}
          {/* <hr />
          <NewTest />*/}
          <hr />
          <Row>
            {props.data.map((contents, num) => (
              <>
                <Col md="4" xs="12">
                  <CardList
                    title={contents.listtitle}
                    num={contents.num}
                    name={contents.name}
                    image={contents.imageLink}
                    props={props}
                  />{" "}
                </Col>{" "}
              </>
            ))}
          </Row>
        </Col>
      </Layout>
    </div>
  );
});
Index.getInitialProps = async function ({ query }) {
  //const url = require("url");
  //console.log(url);
  //  console.log(query.id);
  const res = await axios.get("https://hanstream.gabia.io/contentsList", {});
  const data = await res.data;

  console.log(data);

  console.log(`Show data fetched. Count: ${data.length}`);
  return {
    data: data,
  };
};
export default Index;
